import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import MenuChats from './page-component/menu-chats';
import MyChat from './page-component/myChat'

import '../style/MainPage.css'

const MyPageMessag = () => {
    const navigate = useNavigate();

    useEffect(() => {
        navigate('/mypage');
    }, [navigate]); // Добавляем navigate в зависимости, чтобы effect вызывался только при его изменении

    return (
        <div>
            <MenuChats></MenuChats>
            <MyChat></MyChat>
        </div>
    );
};

export default MyPageMessag;
